import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

// Ensure we're using the correct rendering method based on React version
const root = document.getElementById('root');
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  root
);
